import React from 'react';
import './Discover.css';
import Discover from '../HomeContent/DiscoverTrailers';


function HomeDiscover (props){
    let movieDiscovered;
    if(props.discovered){
        movieDiscovered=props.discovered.map(discover=>{
            return <Discover
         discover={discover} 
         key={discover.id}
         />

        })
    }
    let tvDiscovered;
    if(props.ontv){
        tvDiscovered=props.ontv.map(tv=>{
            return <Discover
         discover={tv}
         key={tv.id}
         />

        })
    }

   
    return(
        <div className="content">
        <div className="title">
        <h3>Movies || Discover</h3>
        
       
        </div>
        <div className="discover">
        {movieDiscovered}
        {tvDiscovered}
        {movieDiscovered}
        </div>           

        </div>
    )
}

export default HomeDiscover;
